const list = [
    {
      sound: 'blablabla',
      list: ['Uno', 'Dos', 'Tres'],
      correctAnswer: 'Tres'
    },
    {
      sound: 'bliblibli',
      list: ['Cuatro', 'Cinco', 'Seis'],
      correctAnswer: 'Cinco'
    },
    {
      sound: 'blobloblo',
      list: ['Siete', 'Ocho', 'Nueve'],
      correctAnswer: 'Ocho'
    }
];

export default list;
